import "./App.css";

function App() {
  return (
    <section className="wrapper">
      <h1>Laba 6 - image encrypt</h1>
      <form>
        <label htmlFor="image">Choose img: </label>
        <input id="image" type="file" accept=".jpeg,.jpg"></input>
        <br />
        <label>Choose type: </label>
        <br />
        <span>
          <label>Read from File <input type="radio" name="checkbox"/></label>
          <label>Write Data <input type="radio" name="checkbox"/></label>
        </span>
      </form>
      <img src="" alt="No img set"></img>
    </section>
  );
}

export default App;
